function showTestimonials(n){var i;var dots=document.getElementsByClassName("dot");var x=document.getElementsByClassName("myTestimonials");if(n>x.length){slideIndex=1}
if(n<1){slideIndex=x.length}
for(i=0;i<x.length;i++){x[i].style.display="none"}
for(i=0;i<dots.length;i++){dots[i].className=dots[i].className.replace("active","")}
x[slideIndex-1].style.display="block";dots[slideIndex-1].className+=" active"};
